import React from 'react';

const BookingSystem = () => {
  return (
    <div className="booking-system">
      <div className="container">
        <h1>Book Appointment</h1>
        <p>Booking system coming soon...</p>
      </div>
    </div>
  );
};

export default BookingSystem;
